import React, { useContext } from 'react';

import {
    Container, InputText, LabelInput
} from './styles';

function Contact() {

    return (
        <Container>

            <LabelInput htmlFor={'name'}>Nome</LabelInput>
            <InputText id={'name'}/>

        </Container>
    );
}

export default Contact;
